export default function Redes() {
  return (
    <div className='RedesSocialesac'>Redes Sociales:

    <a href="https://www.instagram.com/iv_reyna/?fbclid=IwAR0ffrIeitN13Ba2Ttbx6DVsZSB4e3ilo5Yg3BAV0yReJ4wIOEeew0eGSeQ" target="_blank">
      <img src="insta.png" alt="instagram" width="30px" />
    </a>

      <img src="fb.png" alt="facebook" width={'30px'}/><p>Pame Avila</p>
    </div>
  )
}
